import React, { Component } from 'react'
import decodes from 'jwt-decode'


export default class Valid extends Component {

    constructor(props){
        super(props)

        this.state = {}
    }

    componentDidMount(){
        this.getSession()
    }

    getSession = () => {

        var session = localStorage.getItem('session')
        if(session){

            const decode = decodes(session)
            if(decodes(session)){

                var email = decode.email        

                if(email === undefined){
                    alert("lah kocak")
                }else{
                    alert("you good")
                }

            }

        }

    }


    render() {
        return (
            <div>
                {this.props.children}
            </div>
        )
    }
}
